import React from "react";
import "../styles/MainPage.css";

export default function MainPage() {
  // 예시로 추천 취미 리스트 (나중에 알고리즘 결과와 연결)
  const personalHobbies = [
    { name: "자전거 타기", img: "/images/bike.png" },
    { name: "기타 연주", img: "/images/guitar.png" },
    { name: "그림 그리기", img: "/images/paint.png" },
  ];

  // 새로운 취미 리스트 (랜덤 or 전체 중 일부)
  const newHobbies = [
    { name: "요가", img: "/images/yoga.png" },
    { name: "베이킹", img: "/images/baking.png" },
    { name: "하이킹", img: "/images/hiking.png" },
  ];

  return (
    <div className="main-container">
      {/* 헤더 */}
      <header className="main-header">
        <h1 className="logo">custom hobby</h1>
        <a href="/mypage" className="mypage-link">
          마이 페이지
        </a>
      </header>

      {/* 콘텐츠 영역 */}
      <div className="hobby-sections">
        {/* 개인 맞춤 취미 */}
        <section className="hobby-box">
          <h2>개인 맞춤 취미</h2>
          <div className="hobby-list">
            {personalHobbies.map((hobby, index) => (
              <div key={index} className="hobby-item">
                <img src={hobby.img} alt={hobby.name} />
                <p>{hobby.name}</p>
              </div>
            ))}
          </div>
        </section>

        {/* 새로운 취미 */}
        <section className="hobby-box">
          <h2>새로운 취미</h2>
          <div className="hobby-list">
            {newHobbies.map((hobby, index) => (
              <div key={index} className="hobby-item">
                <img src={hobby.img} alt={hobby.name} />
                <p>{hobby.name}</p>
              </div>
            ))}
          </div>
        </section>
      </div>
    </div>
  );
}
